	public static void main(String[] args) {
		launch(args);
	}

	public void start(javafx.stage.Stage stage) throws Exception {

		javafx.scene.layout.GridPane grid = new javafx.scene.layout.GridPane();
		stage.setScene(new javafx.scene.Scene(grid, 1280, 720));
		stage.show();
		

		for (Object[] oneItem : DATA) {
			Thread.sleep(2000);
			grid.getChildren().add(new javafx.scene.image.ImageView(new javafx.scene.image.Image(new java.io.ByteArrayInputStream(java.util.Base64.getDecoder().decode((String)oneItem[5])))));

			javafx.animation.Transition tt, ft;
			
			java.util.stream.Stream.of(((javafx.animation.TranslateTransition)(tt = new javafx.animation.TranslateTransition(javafx.util.Duration.millis(20000), grid.getChildren().get(grid.getChildren().size() - 1)))))
				.forEach(
						((java.util.function.Consumer<javafx.animation.TranslateTransition>)(t -> t.setFromX((int) oneItem[1])))
						.andThen(t -> t.setToX((int) oneItem[2]))
						.andThen(t -> t.setFromY((int) oneItem[3]))
						.andThen(t -> t.setToY((int) oneItem[4]))
						.andThen(t -> t.setCycleCount(javafx.animation.TranslateTransition.INDEFINITE))
						);

			java.util.stream.Stream.of(((javafx.animation.FadeTransition)(ft = new javafx.animation.FadeTransition(javafx.util.Duration.millis(20000), grid.getChildren().get(grid.getChildren().size() - 1)))))
				.forEach(
						((java.util.function.Consumer<javafx.animation.FadeTransition>)(t -> t.setFromValue(0.0)))
						.andThen(t -> t.setToValue(1.0))
						.andThen(t -> t.setAutoReverse(true))
						.andThen(t -> t.setCycleCount(javafx.animation.FadeTransition.INDEFINITE))
						);

			new javafx.animation.ParallelTransition(tt, ft).play();
		}
	}
	
